query getUserTeaPositions($user: Bytes) {
  userPositionTeas(where: { user: $user }) {
    user
    vaultId
    balance
    positionDecimals
    debtToken
    debtSymbol
    collateralToken
    collateralSymbol
    leverageTier
  }
}
